import React from 'react';
import { motion } from 'framer-motion';

const About = ({ theme }) => {
  return (
    <section id="about" className="about-section">
      <div className="about-container">
        <motion.div
          className="about-content"
          initial={{ opacity: 0, y: 50 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
          viewport={{ once: true }}
        >
          <div className="about-text">
            <motion.h2
              className="about-title"
              initial={{ opacity: 0, x: -30 }}
              whileInView={{ opacity: 1, x: 0 }}
              transition={{ duration: 0.6, delay: 0.2 }}
              viewport={{ once: true }}
            >
              About Me
            </motion.h2>

            <motion.div
              className="bio-content"
              initial={{ opacity: 0, x: -30 }}
              whileInView={{ opacity: 1, x: 0 }}
              transition={{ duration: 0.6, delay: 0.4 }}
              viewport={{ once: true }}
            >
              <p className="bio-text">
                Hi, I'm Nyan Aung, a Computer Engineering student at UC San Diego with a genuine passion for becoming a skilled full stack and software engineer. I love taking an idea and turning it into a reliable, well designed application, from an intuitive front end to an efficient and scalable back end.
              </p>

              <p className="bio-text">
                I'm always learning new technologies, refining how I work, and looking for chances to grow through collaboration and real problem solving. I want to join a team that values curiosity, clean code, and a strong engineering mindset, where I can contribute right away and keep evolving as a developer.
              </p>
            </motion.div>
          </div>

          <motion.div
            className="about-image"
            initial={{ opacity: 0, x: 30 }}
            whileInView={{ opacity: 1, x: 0 }}
            transition={{ duration: 0.6, delay: 0.6 }}
            viewport={{ once: true }}
          >
            <div className="image-placeholder">
              <div className="placeholder-content">
                <div className="placeholder-icon">
                  <svg width="60" height="60" viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg">
                    <path d="M12 12C14.7614 12 17 9.76142 17 7C17 4.23858 14.7614 2 12 2C9.23858 2 7 4.23858 7 7C7 9.76142 9.23858 12 12 12Z" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round"/>
                    <path d="M20.59 22C20.59 18.13 16.74 15 12 15C7.26 15 3.41 18.13 3.41 22" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round"/>
                  </svg>
                </div>
                <p className="placeholder-text">Your Photo</p>
              </div>
            </div>
          </motion.div>
        </motion.div>
      </div>

      <style jsx>{`
        .about-section {
          min-height: 100vh;
          display: flex;
          align-items: center;
          justify-content: center;
          padding: 100px 0;
          background: ${theme === 'dark' ? 'linear-gradient(135deg, #042a1c 0%, #042a1c 100%)' : 'linear-gradient(135deg, #EEEEEE 0%, #EEEEEE 100%)'};
        }

        .about-container {
          max-width: 1200px;
          width: 100%;
          padding: 0 20px;
        }

        .about-content {
          display: grid;
          grid-template-columns: 1fr 1fr;
          gap: 80px;
          align-items: center;
        }

        .about-title {
          font-family: 'Poppins', sans-serif;
          font-size: 48px;
          font-weight: 700;
          color: ${theme === 'dark' ? '#e3e5e6' : '#000000'};
          margin-bottom: 40px;
          position: relative;
        }

        .about-title::after {
          content: '';
          position: absolute;
          bottom: -10px;
          left: 0;
          width: 60px;
          height: 4px;
          background: ${theme === 'dark' ? '#e3e5e6' : '#000000'};
          border-radius: 2px;
        }

        .bio-content {
          display: flex;
          flex-direction: column;
          gap: 24px;
        }

        .bio-text {
          font-family: 'Inter', sans-serif;
          font-size: 18px;
          line-height: 1.7;
          color: ${theme === 'dark' ? '#e3e5e6' : '#374151'};
          opacity: 0.9;
        }

        .about-image {
          display: flex;
          justify-content: center;
          align-items: center;
        }

        .image-placeholder {
          width: 300px;
          height: 300px;
          border-radius: 20px;
          background: ${theme === 'dark' ? 'rgba(227, 229, 230, 0.1)' : 'rgba(0, 0, 0, 0.1)'};
          border: 2px dashed ${theme === 'dark' ? 'rgba(227, 229, 230, 0.3)' : 'rgba(0, 0, 0, 0.3)'};
          display: flex;
          align-items: center;
          justify-content: center;
          transition: all 0.3s ease;
        }

        .image-placeholder:hover {
          border-color: ${theme === 'dark' ? 'rgba(227, 229, 230, 0.6)' : 'rgba(0, 0, 0, 0.6)'};
          background: ${theme === 'dark' ? 'rgba(227, 229, 230, 0.15)' : 'rgba(0, 0, 0, 0.15)'};
        }

        .placeholder-content {
          text-align: center;
          color: ${theme === 'dark' ? '#e3e5e6' : '#6b7280'};
        }

        .placeholder-icon {
          margin-bottom: 16px;
          opacity: 0.6;
        }

        .placeholder-text {
          font-family: 'Inter', sans-serif;
          font-size: 16px;
          font-weight: 500;
        }

        @media (max-width: 1024px) {
          .about-content {
            grid-template-columns: 1fr;
            gap: 60px;
            text-align: center;
          }

          .about-title {
            font-size: 42px;
          }

          .about-title::after {
            left: 50%;
            transform: translateX(-50%);
          }

          .image-placeholder {
            width: 250px;
            height: 250px;
          }
        }

        @media (max-width: 768px) {
          .about-section {
            padding: 80px 0;
          }

          .about-container {
            padding: 0 15px;
          }

          .about-content {
            gap: 40px;
          }

          .about-title {
            font-size: 36px;
            margin-bottom: 30px;
          }

          .bio-text {
            font-size: 16px;
            line-height: 1.6;
          }

          .image-placeholder {
            width: 200px;
            height: 200px;
          }

          .placeholder-icon svg {
            width: 50px;
            height: 50px;
          }
        }

        @media (max-width: 480px) {
          .about-title {
            font-size: 28px;
          }

          .bio-text {
            font-size: 15px;
          }

          .image-placeholder {
            width: 180px;
            height: 180px;
          }

          .placeholder-icon svg {
            width: 40px;
            height: 40px;
          }

          .placeholder-text {
            font-size: 14px;
          }
        }
      `}</style>
    </section>
  );
};

export default About;
